import { useSelector } from "react-redux";


export default function MyCalendar(){
    const intervalo=useSelector(state=>state.intervalo)

    return(
        <div>
            
            <div>
                {intervalo.length>1&&intervalo.map((e,i)=>{return
                <li key={i}>{e.desde}/{e.hasta} </li>
                })}
            </div>

        </div>
    )
}
